import "../../assets/sass/sass-components/main-page/nav/nav.scss";

import React from "react";
import { Link } from "react-router-dom";

function Nav(probs) {
  return (
    // <nav className="nav-container">
    <nav
      className={
        window.location.pathname === "/"
          ? "nav-container"
          : window.location.pathname === "/login"
          ? ""
          : ""
      }
    >
      <Link to="/">
        <img id="homebtn" src="/images/home.png"></img>
      </Link>
      <div className="nav-texts">
        <div id="nav-text-id1">MM16z</div>
        <div id="nav-text-id2">Town</div>
        <div id="nav-text-id5">{probs.navCurrentPath}</div>
        <Link id="nav-text-id3" to="/login">
          Login
        </Link>
        <Link id="nav-text-id4" to="/register">
          Register
        </Link>
      </div>
    </nav>
  );
}

export default Nav;
